# Transformando a entrada em uma lista de strings, ignorando linhas vazias
linhas = [linha.strip() for linha in entrada_texto.split('\n') if linha.strip()]

num_linhas = len(linhas)
num_colunas = len(linhas[0])
total_acessivel = 0

# Iterando sobre cada célula da grade
for l in range(num_linhas):
    for c in range(num_colunas):
        # Se a célula contém um rolo de papel '@'
        if linhas[l][c] == '@':
            vizinhos = 0
            # Verificando as 8 posições adjacentes
            for dl in [-1, 0, 1]:
                for dc in [-1, 0, 1]:
                    # Ignorando a própria célula
                    if dl == 0 and dc == 0:
                        continue
                    
                    nl, nc = l + dl, c + dc
                    
                    # Verificando se o vizinho está dentro dos limites da grade
                    if 0 <= nl < num_linhas and 0 <= nc < num_colunas:
                        if linhas[nl][nc] == '@':
                            vizinhos += 1
            
            # Se houver menos de 4 rolos vizinhos, o rolo é acessível
            if vizinhos < 4:
                total_acessivel += 1

print(f"Total de rolos acessíveis: {total_acessivel}")